// Express 4.0


module.exports = function (app) {
    // User Data (DATA)
    // =============================================================
    let users = [{
        "name": "Ahmed",
        "photo": "https://i.ytimg.com/vi/cpL97TGf-mc/maxresdefault.jpg",
        "summary": "i can write",
        "scores": [
            5,
            1,
            4,
            4,
            5,
            1,
            2,
            5,
            4,
            1
        ]
    }, {
        "name": "Tierra",
        "photo": "data:image/jpeg;base64,",
        "summary": "I am a biological human person who enjoys typical human activities including eating and talking.  I am looking for additional human friends to join me for eating and talking.",
        "scores": [
            "4.3",
            "2.8",
            "3.2",
            "0.6",
            "3.5",
            "3.5",
            "1.6",
            "0.4",
            "1.8",
            "3.5"
        ]
    }]

    //Routes
    // =============================================================


    // Displays all users
    app.get("/api/friends", function (req, res) {
        return res.json(users);
    });


    // Handles incoming surveys and returns most compatible friend
    app.post("/api/friends", function (req, res) {
        console.log("tadah");
        // req.body hosts is equal to the JSON post sent from the user
        // This works because of our body parsing middleware
        let newUser = req.body;

        let diff = [];

        for (let i = 0; i < users.length; i++) {
            let comparison = users[i].scores;
            let score = compare(newUser.scores, comparison);
            diff.push(score);
        }

        let friendex = returnIndexofMin(diff);
        let friend = users[friendex];

        res.json(friend);
        users.push(newUser)
    });

    function returnIndexofMin(array) {
        let min = 10000;
        for (let i = 0; i < array.length; i++) {
            if (array[i] < min) {
                min = array[i];
            }
        }
        return array.indexOf(min);
    }

    function compare(array1, array2) {
        let score = 0;
        if (array1.length == array2.length) {
            for (let j = 0; j < array1.length; j++) {
                score += Math.abs(array1[j] - array2[j])
            }
            return score;
        } else {
            throw "Oopsies, something has gone real wrong"
        }
    }
}